def get_function_at(S, t):
    # Gets the function value f(t) at time t, where f(t) is our special filter
    # function with support on [-S,S].   S must be a value we have tabulated
    # the function for, currently either 6 or 10.
    #
    # Note: our filter function is very close to a sinc function times a
    # Gaussian, and looks a little bit like the Mexican hat function; it was
    # numerically optimized to have certain nice properties enabling easy signal
    # reconstruction; see ../filter_shape/notes.txt
    if not S in f:
        raise ValueError("S is not one of the allowed values: currently only support S in",
                         list(f.keys()))

    my_f = f[S]
    assert len(my_f) == S * D
    if t < 0:
        t = -t  # the function is symmetric.

    pos_in_array = t * D
    i = math.floor(pos_in_array)
    p = pos_in_array - i

    val_i = my_f[i] if i < S * D else 0.0
    val_i1 = my_f[i+1] if i + 1 < S * D else 0.0

    # just linearly interpolate between the two values...  they are spaced quite
    # closely, so this should be enough for now; maybe at some point we could
    # make this a better approximation.
    return (1.0 - p) * val_i + p * val_i1

